local function GetWeapon(ent)
	local weapon = ent:get_player_weapon(false)
	if weapon == nil then
        return
    end

	local weapon_id = weapon:get_weapon_index()
	return weapon:get_classname() == "CKnife" and "knife" or (weapon_id == 48) and 46 or weapon_id
end

