end)

events.player_connect_full:set(function(event)
	local localplayer = entity.get_local_player()
	local event_userid = entity.get(event.userid, true)

	if localplayer == event_userid then
		active_locations = {}
		update_active_locations()
		w_locations = {}
		timeout()
	end
end)